
#include "math3d.h"
#include "stabilizer_types.h"
#include <math.h>
#include "log.h"
#include "controller_nn.h"



#define MAX_THRUST 0.1597f
// PWM to thrust coefficients
#define A 2.130295e-11f
#define B 1.032633e-6f
#define C 5.484560e-4f



void controllerNNInit(void) {}



bool controllerNNTest(void) {
	return true;
}



float linear(float num) {
	return num;
}



float sigmoid(float num) {
	return 1 / (1 + exp(-num));
}



float relu(float num) {
	if (num > 0) {
		return num;
	} else {
		return 0;
	}
}


// range of action -1 ... 1, need to scale to range 0 .. 1
float scale(float v) {
	return 0.5f * (v + 1);
}



float clip(float v, float min, float max) {
	if (v < min) return min;
	if (v > max) return max;
	return v;
}



void controllerNN(control_t *control, 
				  setpoint_t *setpoint, 
				  const sensorData_t *sensors, 
				  const state_t *state, 
				  const uint32_t tick)
{
	control->enableDirectThrust = true;
	if (!RATE_DO_EXECUTE(RATE_250_HZ, tick)) {
		return;
	}


	static struct mat33 rot;
	static float state_array[21];

	// based on how the network was trained, the states are absolute
	// struct vec pos = mkvec(state->position.x, state->position.y,state->position.z);
	// struct vec vel = mkvec(state->velocity.x, state->velocity.y,state->velocity.z);

	// Orientation
	struct quat q = mkquat(state->attitudeQuaternion.x, 
						   state->attitudeQuaternion.y, 
						   state->attitudeQuaternion.z, 
						   state->attitudeQuaternion.w);
	rot = quat2rotmat(q);

	// transforming the linear velocity to the world frame
	// float vx = state->velocity.x;
	// float vy = state->velocity.y;
	// float vz = state->velocity.z;

	// float qx = q.x;
	// float qy = q.y;
	// float qz = q.z;
	// float qw = q.w;

	// float world_vx = vx * (1-2*qy*qy-2*qz*qz) + vy * (2*qx*qy-2*qz*qw) + vz * (2*qx*qz+2*qy*qw); 
	// float world_vy = vx * (2*qx*qy+2*qz*qw) + vy * (1-2*qx*qx-2*qz*qz) + vz * (2*qy*qz-2*qx*qw);
	// float world_vz = vx * (2*qx*qz-2*qy*qw) + vy * (2*qy*qz+2*qx*qw) + vz * (1-2*qx*qx-2*qy*qy);

	// angular velocity
	float omega_roll = radians(sensors->gyro.x);
	float omega_pitch = radians(sensors->gyro.y);
	float omega_yaw = radians(sensors->gyro.z);

	// the state vector (goal is fixed to [0.0, 0.0, 2.0] as was trained)
	state_array[0] = state->position.x;//pos.x;
	state_array[1] = state->position.y;//pos.y;
	state_array[2] = state->position.z+1.5f;//pos.z;
	state_array[3] = state->velocity.x;//vel.x; 0
	state_array[4] = state->velocity.y;//vel.y; 0
	state_array[5] = state->velocity.z;//vel.z;
	state_array[6] = rot.m[0][0];
	state_array[7] = rot.m[0][1];
	state_array[8] = rot.m[0][2];
	state_array[9] = rot.m[1][0];
	state_array[10] = rot.m[1][1];
	state_array[11] = rot.m[1][2];
	state_array[12] = rot.m[2][0];
	state_array[13] = rot.m[2][1];
	state_array[14] = rot.m[2][2];
	state_array[15] = omega_roll;
	state_array[16] = omega_pitch;
	state_array[17] = omega_yaw;
	state_array[18] = 0.0;
	state_array[19] = 0.0;
	state_array[20] = 2.0;


	// run the neural neural network
	static struct control_t_n control_n;
	networkEvaluate(&control_n, state_array);

	// convert thrusts directly to PWM
	// need to hack the firmware (stablizer.c)
	int PWM_0, PWM_1, PWM_2, PWM_3; 
	thrusts2PWM(&control_n, &PWM_0, &PWM_1, &PWM_2, &PWM_3);
	// PWM2control(control, PWM_0, PWM_1, PWM_2, PWM_3);
	control->motorRatios[0] = PWM_0;
	control->motorRatios[1] = PWM_1;
	control->motorRatios[2] = PWM_2;
	control->motorRatios[3] = PWM_3;
}


/*
 * Crazyflie rotors positions (as opposed to what the neural network assumes): 
 *							x 
 *							|
 *						3	|	0
 *				 (thrust 0)	|	(thrust 1)
 *				  y <---------------
 *					 		|
 *					 	2	|	1
 *			     (thrust 3) |	(thrust 2)
 *	(thrust projection must align with each motor, e.g thrust 1 is on rotor 0)
 */
void thrusts2PWM(control_t_n *control_n, 
	int *PWM_0, int *PWM_1, int *PWM_2, int *PWM_3){

	// scaling and cliping
	control_n->thrust_0 = MAX_THRUST * clip(scale(control_n->thrust_0), 0.0, 1.0);
	control_n->thrust_1 = MAX_THRUST * clip(scale(control_n->thrust_1), 0.0, 1.0);
	control_n->thrust_2 = MAX_THRUST * clip(scale(control_n->thrust_2), 0.0, 1.0);
	control_n->thrust_3 = MAX_THRUST * clip(scale(control_n->thrust_3), 0.0, 1.0);

	// motor 0
	*PWM_0 = (int)((-B + sqrtf(B * B - 4 * A * (C - control_n->thrust_1))) / (2 * A));
	// motor 1
	*PWM_1 = (int)((-B + sqrtf(B * B - 4 * A * (C - control_n->thrust_2))) / (2 * A));
	// motor 2
	*PWM_2 = (int)((-B + sqrtf(B * B - 4 * A * (C - control_n->thrust_3))) / (2 * A));
	// motor 3 
	*PWM_3 = (int)((-B + sqrtf(B * B - 4 * A * (C - control_n->thrust_0))) / (2 * A));
}


/*
 * the equations are obtained by solving the linear equations in powerDistribution()
*/
void PWM2control(control_t *control, int PWM_0, int PWM_1, int PWM_2, int PWM_3) {
	control->roll = (int)(0.5f * (-PWM_0 - PWM_1 + PWM_2 + PWM_3));
	control->pitch = (int)(0.5f * (PWM_0 - PWM_1 - PWM_2 + PWM_3));
	control->yaw = (int)(0.25f * (PWM_0 - PWM_1 + PWM_2 - PWM_3));
	control->thrust = 0.25f * (PWM_0 + PWM_1 + PWM_2 + PWM_3);
}


